import React from 'react';
import Youtube from '../../assets/pics/youtube.svg';
import Instagram from '../../assets/pics/instagram.svg';
import Twitter from '../../assets/pics/twitter.svg';
import Twitch from '../../assets/pics/twitch.png';
import Discord from '../../assets/pics/discord.png';
import Etsy from '../../assets/pics/etsy.png';
import Tarayah from '../../assets/pics/Tarayah.png';
import World from '../../assets/pics/World.png';

const Header = () => {

	const logo = (

		<div className='header'>
			<img src={Tarayah} alt='Tarayah' className='tarayahHeader'/>
			<img src={World} alt='World' className='worldHeader'/>
		</div>
	)

	const socialsIcon = (

		<div>
		<a href='https://www.youtube.com/channel/UCsTBtbUxAVwsLF8devi7aUA?view_as=subscriber' target='_blank' className='socialsIcon'>
		<img src={Youtube} rel="noopener noreferrer" alt='youtube' className='socialsIcon'/>
		</a>

		<a href='https://www.instagram.com/tarayahworld/?hl=en'  target='_blank' className='socialsIcon'>
		<img src={Instagram} rel="noopener noreferrer" alt='instagram' className='socialsIcon'/>
		</a>

		<a href='https://twitter.com/TarayahWorld'  target='_blank' className='socialsIcon'>
		<img src={Twitter} rel="noopener noreferrer" alt='twitter' className='socialsIcon'/>
		</a>

		<a href='https://www.twitch.tv/tarayah'  target='_blank' className='socialsIcon'>
		<img src={Twitch} rel="noopener noreferrer" alt='twitch' className='socialsIcon'/>
		</a>

		<a href='https://discord.com/invite/WZMFE5W'  target='_blank' className='socialsIcon'>
		<img src={Discord} rel="noopener noreferrer" alt='discord' className='socialsIcon'/>
		</a>

		<a href='https://www.etsy.com/fr/shop/TarayahWorld'  target='_blank' className='socialsIcon'>
		<img src={Etsy} rel="noopener noreferrer" alt='etsy' className='socialsIcon'/>
		</a>
		</div>
	)

	return (

		<div>
		{socialsIcon}
		{logo}
		</div>

	);

};
export default Header;
